$b=Xb(Fb),Tb=Yb((new t).q(Eb,$b)),Gb=Sb(a),ac=(new t).q("Stubborn Repair",Gb),Pc=(new Wb).e('letrec foldLeft acc list fun \x3d list match {\r\n        |  case [] \x3d\x3e acc\r\n        |  case [head] ++ tail \x3d\x3e\r\n        |    let newAcc \x3d (fun acc head) in\r\n        |    foldLeft newAcc tail fun\r\n        |} in\r\n        |letrec foldRight acc list fun \x3d list match {\r\n        |  case [] \x3d\x3e acc\r\n        |  case init ++ [last] \x3d\x3e\r\n        |    let newLast \x3d (fun last acc) in\r\n        |    foldRight newLast init fun\r\n        |} in\r\n        |let l \x3d ["0", "0", "0", "0"] in\r\n        |"\x3ch1\x3eRepair stubborn\x3c/h1\x3e" +\r\n        |"You can change the following 0 to 1 up to 6 times before the program gives up and produces something different:\x3cbr\x3e\\n" +\r\n        |foldLeft "0" l (\r\n        |  \\x.\\y. x match {\r\n        |     case "0" \x3d\x3e y match {\r\n        |       case "0" \x3d\x3e y\r\n        |       case _ \x3d\x3e x\r\n        |     }\r\n        |     case _ \x3d\x3e "0"\r\n        |  }\r\n        |) + !"\x3cbr\x3e\\n" + "Once it becomes 1, you can change the following 1 to 0 up to 6 times before the program displays zero.\x3cbr\x3e\\n" +\r\n        |(foldRight "1" l (\r\n        |  \\x.\\y. y match {\r\n        |     case "1" \x3d\x3e x match {\r\n        |       case "1" \x3d\x3e x\r\n        |       case _ \x3d\x3e y\r\n        |     }\r\n        |     case _ \x3d\x3e "1"\r\n        |  }\r\n        |))'),
